import React from 'react';
import Layout from '../components/Layout';
import MyCard from '../components/StyledCard';
import StyledContainer from '../components/StyledContainer';
import Head from 'next/head';

const lang = {
    "title" : "Programming Languages",
    "items" : [
        "Scala",
        "Python",
        "Javascript",
        "TypeScript",
        "C",
        "C++",
        "Java"
    ]
}
const cs = {
    "title" : "Computer Science Topics",
    "items" : [
        "Concurrency / Synchronization (Sempaphores & mutexes)",
        "Object-Orientated Techniques",
        "Pointers / Pointer arithmetic",
        "Memory Allocation / Management",
    ]
}
const math = {
    "title" : "Math Skills",
    "items" : [
        "Calculus",
        "Linear Algebra",
        "Probability Theory"
    ]
}
const web = {
    "title" : "Web Technologies",
    "items" : [
        "HTML",
        "CSS",
        "Responsive Design",
        "Form Validation",
        "BootStrap",
        "React",
        "Django (Python)",
        "Web Sockets",
        "API Usage",
        "Node JS",
        "HTTP Requests",
        "Ajax",
    ]
}
const db = {
    "title" : "Relational Databases",
    "items" : [
        "MySQL",
        "Postgresql",
    ]
}
const Skills : React.FunctionComponent<{}> = () => {
    return (
        <Layout page="skills">
            <Head>
                <title>Cutlip Development Skills</title>
                <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            </Head>
            <StyledContainer>
                <h1>Skills</h1>
                <MyCard header={lang.title} items={lang.items} headBg="#29b6f6" />
                <MyCard header={web.title} items={web.items} headBg="#29b6f6" />
                <MyCard header={cs.title} items={cs.items}/>
                <MyCard header={db.title} items={db.items}/>
                <MyCard header={math.title} items={math.items}/>
            </StyledContainer>
        </Layout>
    )
}

export default Skills;
